svg.script:
	//======================== begin Javascript ============================================
		var		posX      = 0;
		var		posY      = 0;
		var		deltaX    = 0;
		var		deltaY    = 0;
		var		bSwinging = 0;
		var		bStarted  = 0;
		var		startTime;
		var		endTime;
		var		deltaTime;
		var		sledgeAnchorX = 237;
		var		sledgeAnchorY = 640;
		var		sledgeID;
		var		bellSoundID;
		var		soundEffectID;
		var		travellerID;
		var		initialiVelocity = 0;
		var		intervalID;
		var		velocityID;
		var		intervalIndex = 0;
		var		maxIndex = 0;
		var		gravity = 9.8;    // m/s**
		
		function  getSVGDoc(node) 
		{ 
			if (node.getNodeType()==9) 
				return node; 
			else 
				return node.getOwnerDocument(); 
		}

		function on_load(evt)
		{
			window.JS_svgdoc = getSVGDoc(evt.getTarget());
			window.Traveller_next_update = next_update;
		}

		function OnMouseDownSledge(evt)
		{
			sledgeID = window.JS_svgdoc.getElementById('Sledge');
			bellSoundID = window.JS_svgdoc.getElementById('BellSound');
			soundEffectID  = window.JS_svgdoc.getElementById('SoundEffect');
			travellerID  = window.JS_svgdoc.getElementById('Traveller');
			velocityID  = window.JS_svgdoc.getElementById('velocity');

			posX = evt.getScreenX();
			posY = evt.getScreenY();
			bSwinging = 1;
			bStarted  = 0;
		}

		function OnMouseMoveSledge(evt)
		{
			if (bSwinging == 1)
			{
				if (bStarted == 0)
				{
					startTime = new Date;
					bStarted = 1;
				}

				posX = evt.getScreenX();
				posY = evt.getScreenY();

				if (posX == sledgeAnchorX)
				{
					posX = sledgeAnchorX + 0.001;
				}

				var angle = Math.atan2((sledgeAnchorY - posY) , (-posX + sledgeAnchorX));

				angle = angle * 57.29577951;
				if (angle < 0) angle = 0;
				if (angle > 90) angle = 90;

				setSledge( angle );
			}
		}

		function OnMouseOverBlock(evt)
		{
			if (bSwinging == 1)
			{
				setSledge( 0 );

				deltaX = evt.getScreenX() - posX;
				deltaY = evt.getScreenY() - posY;

				endTime = new Date;
				deltaTime = endTime.getTime() - startTime.getTime();

				// alert('deltaTime = ' + deltaTime );

				initialVelocity = 1500 / deltaTime;
				if (initialVelocity > 13)
					intialVelocity = 13;

				// alert( 'InitialVelocity: ' + initialVelocity );

				// soundEffectID.setAttribute("xlink:href", "hit1.wav" );
				bSwinging = 0;

				intervalIndex = 0;
				maxInterval = Math.ceil(initialVelocity / gravity * 2 * 20 );  // in intervals of 0.1 seconds

				//alert( 'MaxInterval: ' + maxInterval );

				intervalID = window.setTimeout('Traveller_next_update()', 50);
			}
		}

		function next_update ()
		{
			intervalIndex += 1;
			var curTime  = intervalIndex / 20;	// 10 intervals per second

			if (intervalIndex >= maxInterval)
			{
				window.clearTimeout( intervalID );

				altitude = 0;
				setSledge( 90 );
			}
			else
			{
				intervalID = window.setTimeout('Traveller_next_update()', 50);

				velocity = initialVelocity - curTime * gravity;
				altitude = curTime * initialVelocity - 0.5 * gravity * curTime * curTime;
			}

			// did we ring the bell?
			if (true ) // altitude >= 10)
			{
				altitude = 10;
				velocity = 0;
				// alert('ringbell?');

				bellSoundID.beginElement();
			}

			travellerID.setAttribute("y", altitude );
			velocityID.getFirstChild().setData( 't: ' + FFormat(curTime,1) + ' v: ' + FFormat(velocity,1) + ' y: ' + FFormat(altitude,1));
		}

		function FFormat ( val, nDec )
		{
			var mult   = Math.pow(10,nDec);
			var newVal = Math.round(val * mult) / mult;
			if ((Math.round(val) - newVal) == 0)
			{
				for ( i=0; i < nDec; i++ )
				{
					if (i== 0)
					{
						newVal += '.';
					}

					newVal += '0';
				}
			}

			return newVal;
		}

		function	setSledge( angle )
		{
			var	mat = new Matrix;

			mat.translate( sledgeAnchorX, sledgeAnchorY );
			mat.rotate(angle);
			mat.translate( -sledgeAnchorX, -sledgeAnchorY );

			var matStr = 'matrix(' + mat.m[0] + ','+ mat.m[1] + ','+ mat.m[2] + ','+ mat.m[3]+ ',' + mat.m[4]+ ',' + mat.m[5] + ')';
			sledgeID.setAttribute("transform", matStr );
		}

		//---- Matrix object --------------------------
		function Matrix ()
		{
			this.m   = new Array(1,0,0,1,0,0);
			this.tmp = new Array(1,0,0,1,0,0);
		}

		Matrix.prototype.identity  = Matrix_identity;
		Matrix.prototype.translate = Matrix_translate;
		Matrix.prototype.scale     = Matrix_scale;
		Matrix.prototype.rotate    = Matrix_rotate;
		Matrix.prototype.multiply  = Matrix_multiply;

		function  Matrix_translate ( tx, ty )
		{
			this.m[4] += tx * this.m[0] + ty * this.m[2];
			this.m[5] += tx * this.m[1] + ty * this.m[3];
		}

		function Matrix_scale ( sclx, scly )
		{
			//  Assign scaling parms to the temp member
			this.tmp[0] = sclx;                       
			this.tmp[3] = scly;

			this.multiply();
		}

		function Matrix_rotate ( angle )
		{
			// math funcs require radians
			var radians = angle * 0.017453293;

			// alert(' radians: '+ radians);

			this.tmp[0] = Math.cos(radians);
			this.tmp[1] = Math.sin(radians);
			this.tmp[2] = -this.tmp[1];
			this.tmp[3] = this.tmp[0];
			this.tmp[4] = 0.0;
			this.tmp[5] = 0.0;

			// alert('tmp: ' + this.tmp[0] + ','+ this.tmp[1] + ','+ this.tmp[2] + ','+ this.tmp[3]+ ',' + this.tmp[4]+ ',' + this.tmp[5]);

			this.multiply();
		}

		function Matrix_multiply ()
		{
			var	loc = new Matrix;

	   		loc.m[0] = this.tmp[0] * this.m[0] + this.tmp[1] * this.m[2];
			loc.m[1] = this.tmp[0] * this.m[1] + this.tmp[1] * this.m[3];
			loc.m[2] = this.tmp[2] * this.m[0] + this.tmp[3] * this.m[2];
			loc.m[3] = this.tmp[2] * this.m[1] + this.tmp[3] * this.m[3];
			loc.m[4] = this.tmp[4] * this.m[0] + this.tmp[5] * this.m[2] + this.m[4];
			loc.m[5] = this.tmp[4] * this.m[1] + this.tmp[5] * this.m[3] + this.m[5];

			this.m[0] = loc.m[0];
			this.m[1] = loc.m[1];
			this.m[2] = loc.m[2];
			this.m[3] = loc.m[3];
			this.m[4] = loc.m[4];
			this.m[5] = loc.m[5];
		}

		function Matrix_identity ()
		{
			this.m[0] = 1.0;
			this.m[1] = 0.0;
			this.m[2] = 0.0;
			this.m[3] = 1.0;
			this.m[4] = 0.0;
			this.m[5] = 0.0;
		}

	//======================== end of Javascript ============================================
